import axios from 'axios';

export const registration = async(name, lastname, email, password) => {
    try {
        const response = await axios.post(`http://localhost:5000/api/auth/registration`, {
        name,
        lastname,
        email,
        password
        })
        alert(response.data.message)
    } catch (error) {
        alert(error)
    }
}
